import top4 from '../../assets/images/topSearchProduct/top4.jpg'
import top5 from '../../assets/images/topSearchProduct/top5.jpg'
import top6 from '../../assets/images/topSearchProduct/top6.jpg'

const topsearchproductData=[
    {
        id:1,
        img:top1,
        name:"Máy hút bụi",
        isTop: true,
