    {
        id:2,
        img:top2,
        name:'Bút mực gel',
        isTop: true,
    },
    {
        id:3,
        img:top3,
        name:"Củ sạc nhanh",
        isTop: false,
    },
    {
        id:4,
        img:top4,
        name:'Cáp sạc',
        isTop: true,
    },
    {
        id:5,
        img:top5,
        name:'Ví name',
        isTop: true,
    },
    {
        id:6,
        img:top6,
        name:'Sữa rửa mặt',
        isTop: true,
    }
]
export default topsearchproductData;
